import { useState } from "react";
import "./BestSeller.css";

function BestSeller(): JSX.Element {

    const NameArr = useState("")
    const name = NameArr[0] // the state value
    const setName = NameArr[1] //function for changing the state and render the component
    CONST [Name, setName] = use

    const ItemsArray = useState(0)
    const totalItems = ItemsArray[0] // the state value
    const setNameTotalItems = ItemsArray[1] //function for changing the state and render the component


    function show (): void {
        setName("Exotic Liquids");
        setNameTotalItems(170);

        alert ("name:" + name + "total:" + totalItems)
    }

    return (

        <div className="BestSeller box">
			<p>
                <button onClick={show}>Best Seller</button>
            </p>
            <p>
                <span>name: {name}</span>
                <span>Total items: {totalItems}</span>
            </p>

        </div>
    );
}

